import { React } from "react";
import { Jumbotron, Button } from "reactstrap";


const Home = () => {

    return (
        <div>
            <Jumbotron>
                <h1 className="display-3">Hello, world!</h1>
                <hr className="my-2" />
                <p>It uses utility classes for typography</p>
                <Button color="primary">Learn More</Button>

            </Jumbotron>
        </div>
    )
}

export default Home;
